CREATE TABLE Equipment (
    equipment_id INT PRIMARY KEY,
    name VARCHAR(50),
    weight DECIMAL(5,2),
    quantity INT
);

CREATE TABLE Equipment (
  equipment_id INT PRIMARY KEY,
  name STRING,
  type STRING,
  quantity INT
);

CREATE TABLE Weights (
  weight_id INT PRIMARY KEY,
  equipment_id INT,
  weight FLOAT,
  FOREIGN KEY (equipment_id) REFERENCES Equipment(equipment_id)
);

CREATE TABLE Ropes (
  rope_id INT PRIMARY KEY,
  length FLOAT,
  material STRING
);

CREATE TABLE Mats (
  mat_id INT PRIMARY KEY,
  size STRING,
  color STRING
);

CREATE TABLE weights (
  weight_id UUID PRIMARY KEY,
  weight_name STRING,
  weight_size NUMERIC,
  weight_type STRING
);

CREATE TABLE ropes (
  rope_id UUID PRIMARY KEY,
  rope_length NUMERIC,
  rope_material STRING
);

CREATE TABLE mats (
  mat_id UUID PRIMARY KEY,
  mat_size STRING,
  mat_color STRING,
  mat_type STRING
);

CREATE TABLE equipment_inventory (
  inventory_id UUID PRIMARY KEY,
  equipment_id UUID,
  equipment_type STRING,
  quantity INT
);

CREATE TABLE classes (
  class_id UUID PRIMARY KEY,
  class_name STRING,
  instructor_id UUID,
  class_time TIMESTAMP
);
